import React, {useState} from 'react';

import MenuIcon from '@material-ui/icons/Menu';

const SideNav = () => {
    const [state, setState] = useState(false);
    return (
        <div className="sidenav">
            <MenuIcon color="primary" onClick={() => setState(!state)} />
        </div>
    )
}

export default SideNav;
